yHHNRwTB6tg.description:
*모공쟁이들을 위한 피부커버메이크업편에서 제가 베네피트 모공파우더를 소개해드렸는데 많은분들이 댓글로 품절이라 못구한다 선결제도 안되고 예약만된다 구매대행하는곳아냐 등등 많은 댓글이 있었는대요! 이 제품 대신에 소개해드리자면 메이크업포에버의 HD 가루파우더 (또는 uhd가루파우더)!!! 이거 정말진짜! 괜찮거든요!!!ㅠㅠ 이거 진짜 저 믿고 써보세요!!! 베네피트 모공파우더보다 입자가 훨씬 더 곱고 모공커버에도 좋다는분들도 계시더라구요!! 원래 제가 메포 파우더 사러갔다가 영업당한거라.... 제가 얼른 빠른시일내에 영상을 올리도록하겠습니당ㅜㅜㅜㅜ 이걸 많은사람들에게 알려야해ㅠㅠㅠㅠㅠㅠ
*

안녕하세요 조효진입니다! 
오늘은 진짜 내 인생템으로 하는 피부커버 메이크업 하는 법을 가져왔어요ㅎㅎㅎ
그럼 유익하게! 재밌게! 보시고 오늘도 즐거운 하루되세요!
항상 감사드립니다.

* insta : hyojinc_

* e-mail : chohyojin94517@naver.com


-

@수분크림(쿨링효과) : 얼라이브랩 멀티아이스크림

@토너 : 세이어스 위치하젤 토너 / 라벤더

@선크림 : 식물나라 산소수 라이트 선 젤

@프라이머 : 베네피트 더 포어페셔널 프라이머 

@컨실러 : 캔메이크 컬러 믹싱 컨실러 #02호 내추럴 베이지
   컨실러 브러쉬 : 롭스

@파운데이션 : 에스티로더 더블웨어 #쿨바닐라
   파운데이션 브러쉬 : 롭스
   파운데이션 스펀지 : 뷰티블렌더 블랙 퍼프

@파우더 : 베네피트 더 포어페셔널 에이전트 제로 샤인 모공 파우더

@수정화장 시 사용하는 쿠션 :  헤라 uv 쿠션 롱웨이

@렌즈 : 오렌즈 에이드 3콘 브라운 


